import React from "react";
import AnimalCard from "./AnimalCard";
import animalData from "./data";

function App() {
  return (
    <div>
      <div>
        {animalData.map((animal) => (
          <AnimalCard key={animal.name} {...animal} />
        ))}
      </div>
    </div>
  );
}

export default App;
